import React from "react";
import './navbar.css';
/*import { Link } from 'react-router-dom';
import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';*/
import NgonserLogo from './img/ngonserlogo.png'
import Daftar from './img/daftar.png'
import Masuk from './img/masuk.png'


class navbar extends React.Component {
    render() {
        return (
            <div className="navbar">
                <div className="logo">
                    <a href="/"><img src={NgonserLogo} alt="Logo" /></a>
                </div>
                <div className="search">
                    <input type="text" placeholder="Search..." />
                    <button>Search</button>
                </div>
                <div className="links">
                    <a href="/tentangkami">Tentang Kami</a>
                    <a href="kontak">Hubungi Kami</a>
                    <a href="#login"><img src={Masuk} alt="Masuk" /></a>
                    <a href="#register"><img src={Daftar} height={30} alt="Daftar" /></a>
                </div>
            </div>
        );
    }
}

export default navbar;
